window.bookSummaryJSON = "<p>Emily Young had two goals in her life: 1. Make it big in country music. 2. Get the hell out of Bell Buckle.&nbsp;&nbsp;</p> <p>She was doing it. She was on her way, until Cooper Townsend landed backstage at her show in Dallas.&nbsp;&nbsp;</p> <p>This gorgeous, rugged, man of few words was one cowboy she couldn’t afford to let distract her. But with his slow smile and rough hands, she just couldn’t keep away.&nbsp;&nbsp;</p> <p>With outside forces conspiring against them, Cooper hires the McKay-Taggart team to protect her. Emily refuses to let Cooper get hurt because of her. All she wants is to hold onto him, but she knows the right thing to do is to let go....</p>"; 
